import classes from './Portfolio.module.css';
import React from 'react';
import Card from './UI/Card';
import PortfolioItem from './PortfolioItem';

const DUMMYDATA = [
    {id:1, name: "Apple", amount: '5'},
    {id:2, name: "Microsoft", amount: '10'}
]

function Portfolio(){
    const stockList = DUMMYDATA.map(share=>
        <PortfolioItem
            id = {share.id}
            name = {share.name}
            amount = {share.amount}
        />);


    return (
        <Card>
            <ul>
                {stockList}
            </ul>
        </Card>

    )
};

export default Portfolio;
